// src/App.js
import React, { useState } from 'react';
import './App.css';

const Navbar = () => (
  <nav className="fixed top-0 w-full bg-white shadow-md">
    <div className="max-w-6xl mx-auto flex items-center justify-between px-6 py-4">
      {/* Left: Logo */}
      <div className="flex items-center">
        <img src="/logo.jpg" alt="Wix" className="h-8 w-auto" />
      </div>

      {/* Center: Preview Icons */}
      <div className="hidden md:flex items-center space-x-4 text-gray-600">
        {/* Desktop icon */}
        <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9.75 17h4.5M4.5 21h15a1.5 1.5 0 001.5-1.5V5.25A1.5 1.5 0 0019.5 3.75H4.5A1.5 1.5 0 003 5.25V19.5A1.5 1.5 0 004.5 21z" />
        </svg>
        {/* Mobile icon */}
        <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M7.5 2.25h9a2.25 2.25 0 012.25 2.25v15a2.25 2.25 0 01-2.25 2.25h-9A2.25 2.25 0 015.25 19.5v-15A2.25 2.25 0 017.5 2.25z" />
        </svg>
      </div>

      {/* Right: Text & Button */}
      <div className="flex items-center space-x-4">
        <p className="hidden lg:block text-sm text-gray-600">Nhấp vào chỉnh sửa và tạo ra trang web tuyệt vời của riêng bạn</p>
        <a href="#" className="hidden lg:inline text-sm text-gray-600 hover:underline">Đọc thêm</a>
        <button className="bg-black text-white text-sm px-4 py-2 rounded-md hover:bg-gray-800 transition">Chỉnh sửa trang web này</button>
      </div>
    </div>
  </nav>
);

// Thay thế component Hero cũ bằng đoạn này
const Hero = () => (
  <section id="hero" className="hero">
    {/* Decorative blobs */}
    <div className="blob blob--one"></div>
    <div className="blob blob--two"></div>

    <div className="hero-content">
      <h1 className="hero-title">Hello, I’m Anh Đức</h1>
      <p className="hero-subtitle">
        Passionate frontend developer crafting modern web experiences with React.
      </p>
      <a href="#projects" className="btn btn--primary">
        Explore Projects
      </a>
    </div>
  </section>
);

function About() {
  return (
    <section id="about" className="section">
      <h2 className="section-title">About Me</h2>
      <p className="section-text">
        Tôi là một frontend developer với hơn 3 năm kinh nghiệm xây dựng các ứng dụng web nhanh, responsive và dễ dùng.
      </p>
    </section>
  );
}

function Projects() {
  return (
    <section id="projects" className="section alt">
      <h2 className="section-title">Projects</h2>
      <div className="projects-grid">
        {[1,2,3,4].map(i => (
          <div key={i} className="card">
            <h3>Project {i}</h3>
            <p>Short description of project {i}, tech stack: React, CSS, APIs.</p>
            <a href="https://github.com/bckducc/react/tree/master" className="btn-outline">View on GitHub</a>
          </div>
        ))}
      </div>
    </section>
  );
}

function Contact() {
  return (
    <section id="contact" className="section">
      <h2 className="section-title">Contact Me</h2>
      <form className="contact-form">
        <input type="text" placeholder="Your Name" required />
        <input type="email" placeholder="Your Email" required />
        <textarea rows="4" placeholder="Your Message" required />
        <button type="submit" className="btn-primary">Send Message</button>
      </form>
    </section>
  );
}

function Footer() {
  return (
    <footer className="footer">
      &copy; {new Date().getFullYear()} Buscucker Đức. All rights reserved.
    </footer>
  );
}

export default function App() {
  return (
    <>
      <Navbar />
      <main>
        <Hero />
        <About />
        <Projects />
        <Contact />
      </main>
      <Footer />
    </>
  );
}
